import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import { environment } from '../environment.ts';
import Footer from './Footer.js';

const MeritMarksheetList = () => {
  const [marksheets, setMarksheets] = useState([]);

  const apiUrl = environment.apiUrl;

  const fetchMarksheets = () => {
    fetch(`${apiUrl}/api/marksheet/getMeritList`, { credentials: 'include' })
      .then(response => {
        if (response.ok) {
          return response.json();
        }
        throw new Error('Network response was not ok.');
      })
      .then(data => {
        setMarksheets(data);
      })
      .catch(error => {
        console.error('Error fetching marksheets:', error);
      });
  };


  return (
    <div
      style={{
        backgroundImage: `url('./image/welcome.png')`,
        backgroundRepeat: 'no-repeat',
        backgroundAttachment: 'fixed',
        backgroundSize: 'cover',
        height: '100vh', // Full viewport height
        paddingTop: '85px' // Adjust as needed for top padding
      }}
    >
      <h1 align="center" style={{ color: 'pink' }} >Marksheet List</h1>
      <table border="1px" style={{ color: 'yellowgreen' }} width="100%" align="center" className="table">
        <thead align="center">
          <tr>
            <th style={{ color: 'yellowgreen' }}>Name</th>
            <th style={{ color: 'yellowgreen' }}>Roll No</th>
            <th style={{ color: 'yellowgreen' }}>Physics</th>
            <th style={{ color: 'yellowgreen' }}>Chemistry</th>
            <th style={{ color: 'yellowgreen' }}>Maths</th>
          </tr>
        </thead>
        <tbody align="center">
          {marksheets.map(marksheet => (
            <tr key={marksheet._id}>
              <td>{marksheet.name}</td>
              <td>{marksheet.rollNo}</td>
              <td>{marksheet.physics}</td>
              <td>{marksheet.chemistry}</td>
              <td>{marksheet.maths}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <Footer />
    </div>
  );
};

export default MeritMarksheetList;
